import React from "react";
function AreaSpace(props)
{
    return (
        <div >
          <form>
            <input name="title" placeholder="Title" />
            <textarea name="content" placeholder="Take a note..." rows="3" />
            <button onClick={props.click}> Add</button>
          </form>
        </div>
      );
}
export default AreaSpace;
